import {List } from "semantic-ui-react";

function PortfolioStock(props) {


  return (

    <List.Item>
      <List.Content>
      <List.Header>
        <h3> {props.data.ticker}</h3>
        </List.Header>
        {props.data.quantity} Shares 
  Total Value: <span style={{color:`${props.data.color}`}}> ${props}</span> 

      </List.Content>
    </List.Item>
  );
}

export default PortfolioStock
